import React from 'react';
import logo from './logo.svg';
import './App.css';

function Titulo(props){
  return(
    <div>{ props.TituloPrincipal }</div>
  )
}


function Cajatexto(){
  return(
    <div><input type="text" name="nombredelacaja" placeholder="Usuario"/></div>
  )
}

function CajatextoPassword(){
  return(
    <div><input type="password" name="txtPassword" placeholder="**********"/></div>
  )
}

class ButtonLogin extends React.Component{
  render(){
    return(
      <button type="button">Click Me!</button>
    )
  }
}

class FormLogin extends React.Component{
  render(){
    return(
      <div>prueba

      <div><input type="text" name="nombredelacaja" placeholder="Usuario"/></div>
      <div><input type="password" name="txtPassword" placeholder="**********"/></div>
      <div><button type="button">Click Me!</button></div>

      </div>

    )
  }
}

function App(){
  return(
    <div className="App">
      <header className="App-header">


      <FormLogin TituloPrincipal="KeyManage"></FormLogin>

      </header>
    </div>
  )
}





export default App;
